import styled from "styled-components";

function TelaRegistros() {
    const tokenLS = localStorage.getItem("token");
    console.log("Token na pagina de registro: ", tokenLS);
    return (
        <>
        <Header>
            <Title>Ol√°, Fulano</Title>
            <Icon>
                <ion-icon name="log-out-outline"></ion-icon>
            </Icon>
        </Header>
        <Container>

        </Container>
        <Footer>
            <Entrada>

            </Entrada>
            <Saida>

            </Saida>
        </Footer>
        </>
    )
}


const Header = styled.div`
    display: flex;
    align-itens: center;
`

const Title = styled.h2`
    font-size: 26px;
    font-weight: 700;
    color: #FFFFFF;
    margin-left: 24px;
    margin-top: 25px;
`

const Icon = styled.button`
    font-size: 23px;
    color: white;
    background-color: var(--cor-fundo);
    border: 1px solid var(--cor-fundo);
    margin-top: 25px;
    margin-left: 160px;
`
const Container = styled.div`
    width: 326px;
    height: 446px;
    border-radius: 5px;
    background-color: #FFFFFF;
    margin-top: 26px;
    margin-left: 25px;
`
const Footer = styled.div`
    display: flex;
    gap: 15px;
    margin-top: 13px;
    margin-bottom: 16px;
    margin-left: 25px;

`

const Entrada = styled.div`
    width: 155px;
    height: 114px;
    background-color: var(--cor-botao);
`
const Saida = styled.div`
    width: 155px;
    height: 114px;
    background-color: var(--cor-botao);
`


export default TelaRegistros;
